import React from "react";
import { Link } from "react-router-dom";
import Button from "./Button";

export default class Login extends React.Component {
  render() {
    return (
      <div>
            <a href='/login'><Button>Log in</Button></a>
            <Button>Sign in</Button>
      </div>
    );
  }
}
